import React from 'react'
import "./RightStore.css"
const RightStoreBanner = () => {
  return (
    <div className='RightStoreBanner'>
   <span class="material-symbols-outlined">home</span>
   <span class="material-symbols-outlined">application</span>
   <span class="material-symbols-outlined">Remove</span>
       
    </div>
  )
}

export default RightStoreBanner
